import React, { useEffect, useState } from 'react';
import { useParams, Link } from 'react-router-dom';

const UserPage = () => {
    const [user, setUser] = useState(null);
    const [validFriends, setValidFriends] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const config = require('../config.json');

    const { userId } = useParams();

    useEffect(() => {
        fetch(`http://${config.server_host}:${config.server_port}/user/${userId}`)
            .then(response => {
                if (!response.ok) {
                    throw new Error(`HTTP error! status: ${response.status}`);
                }
                return response.json();
            })
            .then(data => {
                setUser(data);
                if (data.friends) {
                    validateFriends(data.friends);
                } else {
                    setLoading(false);
                }
            })
            .catch(error => {
                console.error("Failed to fetch user:", error);
                setError("Failed to load user data");
                setLoading(false);
            });
    }, [userId]);

    const validateFriends = (friends) => {
        const friendIds = friends.split(',').map(id => id.trim());
        fetch(`http://${config.server_host}:${config.server_port}/api/validate-user-ids`, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({ ids: friendIds })
        })
        .then(response => response.json())
        .then(data => {
            setValidFriends(data.validIds);
            setLoading(false);
        })
        .catch(error => {
            console.error("Failed to validate friends:", error);
            setLoading(false);
        });
    };

    const renderFriendLinks = () => {
        return validFriends.map(friendId => (
            <Link key={friendId} to={`/user/${friendId}`} style={{ marginRight: '10px' }}>
                {friendId}
            </Link>
        ));
    };

    if (loading) return <div>Loading...</div>;
    if (error) return <div>Error: {error}</div>;
    if (!user) return <div>No user found.</div>;

    return (
        <div>
            <h1>User Details</h1>
            <div><strong>Name:</strong> {user?.name}</div>
            <div><strong>User ID:</strong> {user?.user_id}</div>
            <div><strong>Review Count:</strong> {user?.review_count}</div>
            <div><strong>Yelping Since:</strong> {user?.yelping_since}</div>
            <div><strong>Useful:</strong> {user?.useful}</div>
            <div><strong>Funny:</strong> {user?.funny}</div>
            <div><strong>Cool:</strong> {user?.cool}</div>
            <div><strong>Elite:</strong> {user?.elite}</div>
            <div><strong>Friends:</strong> {renderFriendLinks()}</div>
            <div><strong>Fans:</strong> {user?.fans}</div>
            <div><strong>Average Stars:</strong> {user?.average_stars}</div>
        </div>
    );
};

export default UserPage;
